module.exports = /*#__PURE__*/JSON.parse('[{"id":"osnovno","title":"Osnovno","items":[{"q":"Što je Thesara?","a":"Thesara je platforma za brzo i jednostavno objavljivanje aplikacija u par klikova. Fokus je na dostupnosti tvoje aplikacije korisnicima iz cijelog svijeta i tvojoj kreativnosti koja napokon ima mjesto gdje se može parkirati."},{"q":"Koje sve aplikacije i kakve aplikacije mogu objaviti?","a":"Sve koje ulaze u onaj pristojni okvir gdje ne vrijeđaš drugoga, ne varaš, ne kradeš i ne lažeš — ali tehnički gledano, sve aplikacije koje ti se vrte u LLM-ovima (kao što su ChatGPT i slični sustavi) će raditi i kod nas."}]},{"id":"objava","title":"Objavljivanje","items":[{"q":"Kako objaviti aplikaciju?","a":"Klikneš na zeleni gumb \'Objavi Aplikaciju\', zalijepiš gotovi kod koji si kopirao iz ChatGPT-a ili nekog drugog LLM sustava, ili jednostavno uploadaš bundle koji si tamo skinuo. Dodaš naslov, opis, odabereš sliku i objaviš. Zatim samo pričekaš da pregledamo i odobrimo aplikaciju i to je to!"},{"q":"Koliko traje objava?","a":"Objava traje od par minuta do par sati, ali brzo ćemo mi to — nadamo se! :) Još smo mladi pa tek razvijamo svoju tehnologiju, ali kako vrijeme prolazi, sve će ići brže i bolje!"},{"q":"Što napraviti ako objava zakaže?","a":"Objava aplikacije može zakazati samo ako ti odbijemo aplikaciju — u tom slučaju dobit ćeš obavijest. Aplikacija može biti i objavljena, ali ne raditi kako si zamislio. Ako si već pokušao objaviti novu, ispravljenu verziju i siguran si da je problem na našoj strani, imaš gumb u detaljima aplikacije \'Prijavi Problem\'. Tamo nam opiši što se događa i posvetit ćemo se tom problemu posebno."}]},{"id":"pohrana","title":"Pohrana i upload","items":[{"q":"Gdje su pohranjeni moji buildovi i uploadi?","a":"Buildovi su pohranjeni u Thesara sustavu, ali svakako čuvaj svoje originale jer mi ne odgovaramo za backup i trajno čuvanje tvojih aplikacija."},{"q":"Što učiniti ako upload ne prođe?","a":"Onda smo i mi u problemu jer smo dosta uvjereni da bi upload trebao uvijek proći. Ako se to ipak dogodi, pošalji nam email na reports@thesara.space i provjerit ćemo što se dogodilo."}]},{"id":"korištenje","title":"Korištenje aplikacija","items":[{"q":"Kako mogu koristiti svoju aplikaciju?","a":"Aplikaciju možeš koristiti privatno ili ju možeš staviti na korištenje svim korisnicima. Možeš ju ponuditi besplatno ili odrediti mjesečnu cijenu — kako za pojedine aplikacije, tako i za cijeli tvoj repozitorij. To drugim korisnicima omogućava da za jednu cijenu koriste sve aplikacije koje si objavio. Mi uzimamo 30% provizije, ali sve detalje možeš pročitati u Termsima na dnu stranice (footer link)."},{"q":"Kada mogu isplatiti zarađena sredstva?","a":"Kada sakupiš minimalno 50 USD na računu, odmah možeš zatražiti isplatu. Naravno, postoji transakcijska naknada koja ovisi o servisu koji odabereš za isplatu — ali sve će ti biti jasno prikazano tijekom procesa isplate, kao i kod drugih servisa."}]},{"id":"podrska","title":"Prijedlozi i podrška","items":[{"q":"Kako vam mogu poslati prijedlog?","a":"Na naslovnici se nalazi link \'Vaši prijedlozi\' — klikni i pošalji nam što ti padne na pamet. Volimo ideje, pogotovo one koje pomognu da Thesara postane još bolja!"},{"q":"Gdje mogu pronaći dodatne upute?","a":"Dodatne informacije možeš pronaći ovdje u FAQ-u ili nas kontaktirati direktno putem support@thesara.space."}]},{"id":"ambasador","title":"Ambassador program","items":[{"q":"Što je Ambassador program?","a":"Kratak program za entuzijaste koji žele promovirati Thesaru. Prijavi se putem obrasca u sučelju i postani dio tima koji gradi budućnost kreativnosti!"}]}]');

